import { View, Text, StyleSheet } from 'react-native'
import React from 'react'

const StandardView = () => {
  return (
    <View style={styles.container}>
      
    </View>
  )
}


const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#fff',
      alignItems: 'center',
      justifyContent: 'center',
    },
  });
  

export default StandardView
